// pages/SignupPage.js
import React from 'react';
import SignupForm from '../components/SignupForm';

const SignupPage = () => {
  return (
    <div>
      <h1>Welcome to the Throttle Devs Signup Page</h1>
      <SignupForm />
    </div>
  );
};

export default SignupPage;
